import React from 'react'
import { AppBar, Typography, Toolbar } from '@material-ui/core'
import AcUnitRoundedIcon from '@material-ui/icons/AcUnitRounded';

const Header = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography>
                    This is our header
                </Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Header
